import React from 'react';

import '../../normalize.scss';
import '../../base.scss';

import Banner from '../../components/Header/Banner';
import View from "../view/view";
import Converter from "../../components/Converter";
import { Provider as AlertProvider } from "react-alert";
import AlertTemplate from "react-alert-template-basic";

import imgBanner from '../../components/Header/Banner/destaques/CompresuasStars/1280.png'

function ConverterStars() {
  let contentBanner = "In tempor lectus eros, in tempor augue aliquam in"
  return (
    <View public={true}>
      <Provider>
      <Banner imagemBanner={imgBanner} text={contentBanner} />
      <Converter />
      </Provider>
    </View>
  )
}

export default ConverterStars;
